import React, { useEffect, useState } from "react";

const DoctorsList = () => {
  const [doctors, setDoctors] = useState([]);
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const response = await fetch("https://ahd.instapract.ae/web/api/doctor/doc-list", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            APPID: "Gem3s12345",
            Authorization: `Bearer ${token}`,
          },
        });

        const data = await response.json();
        console.log("Doctors List API Response:", data);

        if (response.ok && Array.isArray(data.data)) {
          setDoctors(data.data);
        } else {
          setDoctors([]);
        }
      } catch (error) {
        console.error("Error fetching doctors:", error);
      }
    };

    if (token) {
      fetchDoctors();
    } else {
      console.warn("No token found in localStorage.");
    }
  }, [token]);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Doctors List</h2>
      {doctors.length === 0 ? (
        <p className="text-gray-500">No doctors found.</p>
      ) : (
        <ul className="space-y-2">
          {doctors.map((doc, index) => (
            <li key={index} className="p-3 border rounded shadow">
              {doc.name || doc.doctor_name || doc.full_name || "No Name"} -{" "}
              {doc.speciality || doc.specialty || "No Speciality"}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default DoctorsList;
